import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import logo from "../images/hand-book-logo-illustration-art-background-43965136.webp";

const StudentById = () => {
  const [data, setData] = useState([]);
  const { passingId } = useParams();
  const { id } = `ObjectId(${useParams()})`;
  console.log(passingId);

  useEffect(() => {
    async function Res() {
      const result = await fetch("http://localhost:5555/students");
      const res = await result.json();
      setData(res.data);
    }

    Res();
  });

  return (
    <div>
      {data.map((ele, ind) => {
        if (ele._id === id) {
          return
        }
      })}

      <div>
        <table className="table">
          <tr>
            <th>Sr. No.</th>
            <th>Book Name</th>
            <th>Auther</th>
            <th>Edition</th>
            <th>Books Taken</th>
          </tr>
          <tr>
            <td>01</td>
            <td>Vishudhhi Marg</td>
            <td>Budhhaghosh</td>
            <td>1</td>
            <td>01</td>
          </tr>
          <tr>
            <td>02</td>
            <td>Buddha & His Dhamma</td>
            <td>Dr. B R Ambedkar</td>
            <td>5</td>
            <td>01</td>
          </tr>
        </table>
      </div>
    </div>
  );
};

export default StudentById;
